import React from "react";
import "react-responsive-carousel/lib/styles/carousel.min.css"; //
import { Carousel } from "react-responsive-carousel";
import Game from "./Game";

const slide = (props) => {
  return (
    <Carousel>
      <div>
        <Game />
      </div>
      <div>
        <Game />
      </div>
      <div>slide 3</div>
      <div>slide 4</div>
    </Carousel>
  );
};

export default slide;
